import React from 'react';
import defaultImg from '../Utility/defaultImg.jpg'
import GithubImage from '../Utility/GitHub-Mark/GitHub-Mark/PNG/GitHub-Mark-Light-32px.png'
const Footer = () => {
    return (
        <div className='w-screen bg-blue-800 text-white font-bold'>
            <span className='mx-auto'>
                Created By Rohan Gupta. Check out my Github Profile
            </span>

            <img src={GithubImage} alt={defaultImg} />
        </div>
    )
}

export default Footer;
